import logo from './logo.svg';
import {useState} from 'react';
import './App.css';

function App() {
  const [books, setBooks] = useState([])

  useEffect(() => {
    fetch('http://127.0.0.1:5000', {
      'method': 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
    })
    .then(resp => resp.json())
    .then(resp => console.log(resp))
    .then()
  }, [])
  return (
    <div className="App">
      <h1>Flask and ReactJS course</h1>
    </div>
  );
}

export default App;
